import React, { Component } from 'react';
import CardList from '../Components/CardList'

export default class Catalog extends Component {
    state = {
        all: [
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
