            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'},
            {name: 'Louis XVI ATHOS', cost: '165 000 руб.', img: './62050 1.png'}
        ]
    }

    render(){
        return (
            <div className='supply'>
                 <div className='main__collection-title supply__title'>КАТАЛОГ</div>
                <CardList
                    data={this.state.all}
                />
            </div>
        )
    }
}
